    d[0][7][0] = 2
    dx = [1, 1, 1, 0, 0, -1, -1, -1, 0]
    dy = [1, 0, -1, 1, -1, 1, 0, -1, 0]
    ans = 'LOSE'
    for i in range(99):
        for x in range(8):
            for y in range(8):
