                        valid = False
                    if 0 <= nx - i - 1 < 8 and board[nx - i - 1][ny] == 'S':
                        valid = False
                    if not valid:
                        continue
                    d[i + 1][nx][ny] = 1
                    if nx == 0 and ny == 7:
                        ans = 'WIN'
    return ans

